import React from "react";
import Header from "./Header";
const Login = () => {
  return (
    <div>
      <Header />
      <div className="">
        <img
          className="w-full h-screen object-cover absolute"
          src="https://assets.nflxext.com/ffe/siteui/vlv3/4ffe3d37-1fc1-4d93-b61a-1fa58c11ccff/web/IN-en-20251124-TRIFECTA-perspective_9f00d07d-f08e-494f-8907-92371138c534_small.jpg"
          alt="Login Background"
        />
      </div>

      <form className="absolute p-12 bg-black w-3/12 my-36 mx-auto right-0 left-0 text-white">
        <h1 className="text-3xl font-bold mb-4">Sign In</h1>
        <input type="email" placeholder="Email Address" className="p-2 m-2" />
        <input type="password" placeholder="Password" className="p-2 m-2" />
        <button className="p-4 m-4">Sign In</button>
      </form>
    </div>
  );
};

export default Login;
